import { Component } from '@angular/core';
import { ServicioConsumoService } from 'src/app/service/servicio-consumo.service';
@Component({
  selector: 'app-empleados',
  templateUrl: './empleados.component.html',
  styleUrls: ['./empleados.component.css']
})
export class EmpleadosComponent {
constructor(public service:ServicioConsumoService){
this.service.obtenerEmpleados();
}

get resultados(){
  return this.service.resultados
}
}
<div class ="container">
    <h1>Listado de empleados</h1>
    <table class ="table table-bordared" width="100%" [cellPadding]="0"></table>
    <thead>
        <th>nombre</th>
        <th>apellido paterno</th>
        <th>apellido materno</th>
        <th>puesto</th>
        <th>salario</th>
    </thead>

    <tbody>
        <tr *ngFor="let TDC of resultados">
            <td>{{td.NombreEmpleado}}</td>

        </tr>

    </tbody>
</div>
